import React from 'react';

export default function About() {
  return (
    <div>
      About
      <h1>About this App</h1>
      <p className='my-1'>
        This is a full stack React App for keeping Contacts
      </p>
      <p className='bg-dark p'> Version 1.0 </p>
    </div>
  );
}
